const [ matches, setMatches ] = useState([]);
const {teamName,year} = useParams();

useEffect(
  () => {
    const fetchMatches = async () => {
      const response = await fetch(`http://localhost:8080/team/${teamName}/matches?year=${year}`);
      const data = await response.json();
      setMatches(data);
    };

    fetchMatches();


  },[]
);

